import React from "react";

const SearchPage = ()=>{
    return(
        <div className="flex w-full">
            <form className="m-auto my-40">
                <input placeholder="Enter movie ..." className="p-2 mr-4 border-red-800 border-2 rounded-md outline-none"></input>
                <button className="border-solid border-2 rounded ... border-red-900 bg-red-800 text-white px-4 py-2 m-2">Search</button>
            </form>
        </div>
    )
}
export default SearchPage
